                      <script>
                        
  const sliderrrr = document.querySelector('.sliderrrr');
  const prevBtnnnn = document.querySelector('.prevvvv');
  const nextBtnnnn = document.querySelector('.nextttt');

  let counterrrr = 0;
  const slideWidthhhh = sliderrrr.offsetWidth /2.5;

  nextBtnnnn.addEventListener('click', () => {
    if (counterrrr < 3) {
      counterrrr++;
      sliderrrr.style.transform = `translateX(${-slideWidthhhh * counterrrr}px)`;
    }
  });

  prevBtnnnn.addEventListener('click', () => {
    if (counterrrr > 0) {
      counterrrr--;
      sliderrrr.style.transform = `translateX(${-slideWidthhhh * counterrrr}px)`;
    }
  });

  </script>
@endsection